import style from './mystyle.module.css';
import {
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBCardImage,
  MDBBtn,
  MDBRow,
  MDBCol
} from 'mdb-react-ui-kit';

function ProfileCard({professionalExperience, image, body}){
    //argument destructuring
    // const {professionalExperience} = props
    return (

            <MDBCard className={style.card} style={{ maxWidth: '540px' }}>
                <MDBRow className='g-0'>
                  <MDBCol md='6' xs='0'>
                    <MDBCardImage className={style.cardimage} src={image} alt='professinal experience images'  />
                  </MDBCol>
                  <MDBCol md='6' xs='12'>
                    <MDBCardBody className={style.body}>
                      <MDBCardTitle className={style.cardtitle}>{professionalExperience}</MDBCardTitle>
                      <MDBCardText className={style.cardtext}>
                        {body}
                      </MDBCardText>

                    </MDBCardBody>
                  </MDBCol>
                </MDBRow>
              </MDBCard>

    );
}

export default ProfileCard;
